import React from "react";

const Qna = () => {
  return (
    <div className="ang1">
      <nav className="Header">
        <ul>
          <button>
            <a href="register">회원가입</a>
          </button>
          <button>
            <a href="login">로그인</a>
          </button>
          <button>
            <a href="qna">QNA</a>
          </button>
        </ul>
      </nav>
    </div>
  );
};

export default Qna;
